    return (
        <div>
        <div className="bg-yellow-300 flex justify-between text-white p-3">
            <div className="font-bold">
                Fausto Coffee
            </div>
            <div>
                <a href="https://www.facebook.com/BelieveinbetterCOFFEE/"><FacebookIcon /></a>
                <EmailIcon />
            </div>
        </div>
        </div>
        
    );
}

